import React from 'react';
import { BrowserRouter as Router, Switch, Route } from 'react-router-dom';
import Home from './Home';
import InnovatorRegistration from './InnovatorRegistration';
import CapitalSourceRegistration from './CapitalSourceRegistration';

const App = () => {
  return (
    <Router>
      <Switch>
        <Route exact path="/" component={Home} />
        <Route path="/RegistrationI" component={InnovatorRegistration} />
        <Route path="/register/capital-source" component={CapitalSourceRegistration} />
      </Switch>
    </Router>
  );
};

export default App;
